//@ts-nocheck
import React from 'react';
import {Col, Panel, Row} from 'rsuite';
import TableV from './Table';



const Card = props => (
  <Panel {...props} bordered shaded  bodyFill style={{ width:"139.5%", backgroundColor:"white" , margin:"30px",marginLeft:"40px"}}>

  </Panel>
);

const cardSection2 = ()=>{
return (
  <Row>
    <Col>
      <Card >
       <TableV/>
      </Card>
    </Col>


  </Row>
);
}

export default cardSection2;
